// App.js
import React from 'react';
import './App.css';

function App() {
  const handleLogout = () => {
    // handle logout logic
  };

  return (
    <div className="app">
      <header className="header">
        <h1>My App</h1>
        <button onClick={handleLogout}>Logout</button>
      </header>
      <div className="main">
        <div className="sidebar">
          <nav>
            <ul>
              <li>Home</li>
              <li>User Management</li>
            </ul>
          </nav>
        </div>
        <div className="content">
          <p>Some content message here...</p>
        </div>
      </div>
    </div>
  );
}

export default App;
